!function(){function a(a){return a&&a.__esModule?a.default:a}var e={};e=JSON.parse('{"titulo":"Fiestas de Moros y Cristianos","subtitulo":"En honor a la Virgen de las injurias","fecha":"Del 12 al 15 de octubre","media":"https://www.youtube.com/embed/FM6jGYCIt-Q?si=_4rVl3vxgVEflxyp","tituloLista":"Actos Principales","lista":[{"acto":"<b>Acto</b>:L\'arrancà","dia":"12 de octubre a las 12:30"},{"acto":"<b>Acto</b>:Entrà Cristiana","dia":"12 de octubre a las 19:00"},{"acto":"<b>Acto</b>:Entra infantil Mora i Cristiana","dia":"13 de octubre a las 11:30"},{"acto":"<b>Acto</b>:Entrà Mora","dia":"13 de octubre a las 18:30"},{"acto":"<b>Acto</b>:Tiroteig i Ambaixà Mora","dia":"14 de octubre a las 16:30"},{"acto":"<b>Acto</b>:Tiroteig i Ambaixà Cristiana","dia":"15 de octubre a las 16:30"}],"parrafo1":"Cada dissabte de festes, a les dotze del migdia, Callosa enceta les seues festes de Moros i Cristians amb la tradicional Arrancà de dolçaines. Els passacarrers del dissabte de festes ja són peces tradicionals de les colles dolçaineres, i és ací on prenen la seua raó de ser. A partir d’eixe moment, comencen quatre dies d’actes festers, música i sentiment fester.","parrafo2":"Des de 1860, fent festes de Moros i Cristians.","parrafo3":"La missió de l’Associació és organitzar una de les festes més veteranes del mon fester. Sóm més de 2.800 socis, dels quals, 1.000 són socis festers, és a dir, pertanyen a alguna filà, i la resta són socis no festers."}');var o={};o=JSON.parse('{"titulo":"Jornadas de la Cuchara","subtitulo":"Arroces, fideuás, calderetas, olletas y minchos","fecha":"Del 1 al 30 de noviembre","media":"https://www.youtube.com/embed/POv5lHZvPzk?si=80-mkialNN5WPK2R","tituloLista":"Restaurantes Participantes","lista":[{"acto":"Restaurante Casa Marcos","dia":"2 y 3 de noviembre"},{"acto":"Restaurante Algar de Don Joan","dia":"9 y 10 de noviembre"},{"acto":"Restaurante La Fonda","dia":"15 y 30 de noviembre"},{"acto":"Restaurante Les Fonts","dia":"15 y 16 de noviembre"},{"acto":"Restaurante El Valle","dia":"23 y 24 de noviembre"}],"parrafo1":"Destaca el “putxero amb pilotes”, plato típico en fiestas patronales de Moros y Cristianos. Que consta de tres platos: sopa de fideos hecha con el caldo del cocido, pelotas de carne picada envueltas en hojas de col hervida y el “putxero” (cocido) hecho con la carne y los garbanzos.","parrafo2":"El arroz es la base de otros muchos platos importantes, como el “arròs en costra”, plato típico de carnaval. Es un arroz seco y contiene entre otros ingredientes, embutidos, cubierto de huevo batido, hecho al horno en cazuela de barro. Otros arroces a destacar son el “arròs al forn” (arroz al horno) y “l’olleta”.","parrafo3":"El plato típico de los días de lluvia lo constituyen los “minxos”. Se trata de una base hecha de pasta de harina, escaldada, sobre la que se ponen todo tipo de verduras troceadas (fresca y en salmuera) y pescado (pescadilla y “sepionet”) que se coloca sobre una tabla de madera para llevar a ser horneado. Se come acompañado de “all i oli” y vino tinto."}');var s={};s=JSON.parse('{"titulo":"Patrimonio Cultural","subtitulo":"Desde un excelente paraje natural hasta un hermoso casco antiguo","fecha":"Del 1 al 30 de noviembre","media":"https://www.youtube.com/embed/X6XC2cdNE08?si=mBIxh7pvCHCn4pGd","tituloLista":"Sitios importantes","lista":[{"acto":"Les fontes del algar","dia":"<a href=\'https://lasfuentesdelalgar.com/\'>Visitar Web</a>"},{"acto":"El Portal","dia":""},{"acto":"Museo Etnológico y Arqueológico","dia":""},{"acto":"Iglesia Arciprestal de San Juan Bautista","dia":""},{"acto":"El Poador de la Font Major","dia":""}],"parrafo1":"La primera noticia que se tiene de la Iglesia actual es del año 1574, cuando se constituye la Iglesia Parroquial de Callosa que en el año 1578 fue inaugurada por Francisco de Mesa. En la segunda mitad del siglo XVIII se plantea su ampliación y en 1765 empieza la construcción del crucero acabándose en el año 1786. En el año 1819 las obras son en la fachada que se realiza en mármol de las canteras locales y que no se finaliza hasta el año 1865. El cuerpo superior de la fachada no se hará hasta el año 1917, pero no en mármol negro sino en cemento pintado imitando al mármol.","parrafo2":"El órgano de la Iglesia de San Juan Bautista es un órgano barroco construido, supuestamente, en el año 1754 por Bartolomé Sanchez para un convento de Cocentaina, y que fue comprado y trasladado a Callosa en el año 1845.","parrafo3":"Exteriormente el instrumento nos presenta una fachada estilo neoclásico de madera natural de acuerdo con el resto la iglesia. Dado el buen estado del órgano se sigue utilizando con mucha frecuencia en conciertos y misas."}');var t={};t=JSON.parse('{"titulo":"Cooperativa Ruchey","subtitulo":"Nisperos con denominación de origen","fecha":"Visitas Del 1 de julio al 30 de agosto","media":"https://www.youtube.com/embed/nQORf_fiUZ4?si=hylTlJKeHIpZnMGu","tituloLista":"Principales productos","lista":[{"acto":"Nisperos","dia":"De marzo a mayo"},{"acto":"Aguacates","dia":"De octubre a diciembre y de abril a junio"},{"acto":"Naranja","dia":"Todo el año"},{"acto":"Limones","dia":"Todo el año"},{"acto":"Pitallas","dia":""}],"parrafo1":"Actualmente, en la Cooperativa Agrícola Callosa de’n Sarrià seguimos creciendo y, de manera contínua, nos adaptamos a las nuevas necesidades de nuestros clientes por eso, nuestros esfuerzos están dirigidos a la calidad, la innovación y la excelencia.Todo ello, forma parte del saber hacer de nuestro equipo humano, personas comprometidas y motivadas para hacer realidad nuestra razón de ser: nuestros clientes.","parrafo2":"A través de nuestras marcas reconocidas Ruchey y Font d’Algar, comercializamos las frutas y hortalizas producidas por nuestros socios agricultores y, de este modo, nos aseguramos de que nuestros clientes reciban la máxima calidad al mejor precio.","parrafo3":"Además de nuestra dedicación en el área Hortofrutícola, ofrecemos a nuestros agricultores asociados los diferentes productos y, el asesoramiento profesional para la aplicación de los tratamientos adecuados a sus campos y otros productos alimentarios, a través de nuestra área de Suministros."}');let r=new URLSearchParams(window.location.search).get("det"),i="";switch(r){case"fiesta":i=/*@__PURE__*/a(e);break;case"gastronomia":i=/*@__PURE__*/a(o);break;case"cultura":i=/*@__PURE__*/a(s);break;case"ruchey":i=/*@__PURE__*/a(t)}document.addEventListener("DOMContentLoaded",()=>{let a=document.getElementById("title"),e=document.getElementById("subtitle"),o=document.getElementById("fecha"),s=document.getElementById("media"),t=document.getElementById("tituloLista"),r=document.getElementById("lista"),n=document.getElementById("parrafo1"),l=document.getElementById("parrafo2"),d=document.getElementById("parrafo3");a.innerHTML=i.titulo,e.innerHTML=i.subtitulo,o.innerHTML=i.fecha,s.src=i.media,t.innerHTML=i.tituloLista;let c="";i.lista.forEach(a=>{c+=`<li>${a.acto} ${a.dia}</li>`}),r.innerHTML=c,n.innerHTML=i.parrafo1,l.innerHTML=i.parrafo2,d.innerHTML=i.parrafo3})}();
